  return (
    <div className="App">
      <header className="App-header">
        <h1>Water Weight Donations</h1>
        <p>Help us reach our fundraising goal!</p>
      </header>
      <main>
        <DonationTracker />
      </main>
    </div>
  );
}

export default App;
